import './App.css';
import React, {useState, useEffect} from 'react';
import { useParams } from "react-router-dom";
import FlashCard from './FlashCard';

function FlashCards() {
    let { id } = useParams();
    return(
        <div>
            <FlashCard card={id}/>
        </div>
    );
}

export default FlashCards;
